contrato.objetoResumido:
O presente contrato tem como objeto: Contratação de empresa especializada para elaboração de Projeto urbanístico de infra - estrutura e de habitação nas seguintes Comunidades: 

1- Vila Aparecida I;
2- Vila Aparecida II;
3- Comunidade do Arranha Céu;
4- Comunidade de Nova Jerusalém;
5- Comunidade de Mac Larem.

 No Município de Florianópolis-SC - (conforme especificações e planilhas anexas ao termo de referência).
